import React from "react";
import avatar from "../../images/subhan.png";
import './Profile.css';

const Profile = () => {
  return (
    <>
    <div className="profileContainer">
      <div className="details">
        <p>
          Hello, I'm <br />
          <span></span> SUBHAN SAHEB SHAIK
          <br />A COMPUTER SCIENCE STUDENT
        </p>
      </div>
      <div className="photo">
        <img src={avatar} alt="" />
      </div>
    </div>
    </>
  );
};

export default Profile;
